pub fn build_ignite_wallet_addr_scilla_code_map() -> Result<HashMap<Address, Code>> {
    let mut map: HashMap<Address, Code> = HashMap::new();
    for (address, init_data, types) in IGNITE_WALLET_ADDR_INIT_DATA_AND_TYPES {
        // Transistions struct is the same for all contracts apart from the RecovererSignedMsg address, so overwrite that only
        let mut transitions: Vec<crate::scilla::Transition> =
            serde_json::from_slice(&hex::decode(IGNITE_WALLET_SCILLA_TRANSITIONS)?)?;
        for transition in transitions.iter_mut() {
            if transition.name == "RecoverWallet" {
                transition.params = vec![
                    TransitionParam {
                        name: "msgs".to_string(),
                        ty: format!(
                            "List ({}.RecovererSignedMsg)",
                            address.to_string().to_lowercase()
                        ),
                    },
                    TransitionParam {
                        name: "nominated_admin".to_string(),
                        ty: "ByStr33".to_string(),
                    },
                ];
            }
        }
        map.insert(
            address,
            Code::Scilla {
                code: serde_json::from_slice(&hex::decode(IGNITE_WALLET_SCILLA_CODE)?)?,
                init_data: serde_json::from_slice(&hex::decode(init_data)?)?,
                types: serde_json::from_slice(&hex::decode(types)?)?,
                transitions,
            },
        );
    }
    Ok(map)
}
